Классическая лазанья\n	\nИнгредиенты\n•\t2 столовые ложки оливкового масла;\n•\t1 луковица;\n•\t500 г говяжьего фарша;\n•\tсоль — по вкусу;\n•\tмолотый чёрный перец — по вкусу;\n•\t500 г пассаты или свежих помидоров без шкурки, нарезанных мелкими кубиками;\n•\t1 чайная ложка сушёного базилика;\n•\t40 г сливочного масла + немного для смазывания;\n•\t40 г муки;\n•\t400 мл молока;\n•\tсоль — по вкусу;\n•\tмолотый чёрный перец — по вкусу;\n•\tмолотый мускатный орех — по вкусу;\n•\t250 г листов для лазаньи;\n•\t50 г пармезана.\nПриготовление\nРазогрейте в сковороде масло и пассеруйте мелко нарезанный лук до золотистого цвета. Выложите фарш и обжаривайте, помешивая, до готовности мяса. Приправьте солью и перцем.\nДобавьте пассату или помидоры, перемешайте и готовьте на медленном огне около 10 минут. Затем соедините массу с базиликом.\nВ сотейнике растопите масло на умеренном огне. Помешивая венчиком, всыпьте муку. Не переставая взбивать смесь, постепенно влейте молоко. Варите соус бешамель, постоянно помешивая, пока он не загустеет. Приправьте солью, перцем и мускатным орехом.\nСмажьте маслом форму для запекания. Выложите на дно несколько листов для лазаньи и покройте их частью соуса. Распределите сверху часть мясной начинки. Повторите слои. Сверху должен оказаться соус бешамель, посыпанный тёртым пармезаном. Запекайте 30 минут при температуре 190 °C.\n\n	4	s	i	CAT3	f	7
Крабовый салат с кукурузой и с огурцом	\nИнгредиенты:\n•\t300 грамм крабовых палочек;\n•\tДва куриных яйца;\n•\t3 свежих огурца;\n•\t250 грамм круглого нешлифованного риса;\n•\t1 банка консервированной кукурузы;\n•\tОдна луковица;\n•\tМайонез;\n•\tСоль;\n•\tПерец черный.\nПошаговое приготовление:\n•\tДля начала разморозьте крабовые палочки. Для этого положите их в небольшую чашечку и слегка залейте кипятком. Пара секунд и можете приступать к их очистке от упаковки.\n•\tКрабовые палочки нарежьте на аккуратненькие небольшие ломтики.\n•\tОтварите до готовности куриные яйца, затем остудите их в ледяной воде.\n•\tВ кипящую слегка подсоленную воду высыпьте промытый рис. Отварите его в течение 20-25 минут, до готовности.\n•\tПосле того как очистили отварные яйца от скорлупы, порежьте их маленькими кубиками.\n•\tПовторите процесс со свежими огурцами, порезав их на брусочки.\n•\tИспользуя острый нож, измельчите очищенную луковицу.\n•\tТак как наш салат не предполагается быть слоенным, то в достаточно глубокую и большую чашу выложите все подготовленные компоненты нашего салата.\n•\tУлучшите вкус салата, добавив в него специи в виде соли и черного перца.\n•\tСмешайте все ингредиенты, залив их майонезной заправкой.\n•\tСделайте подачу салата эффектной, подав его на порционных тарелочках, используя круглую кулинарную форму.\n\n\n	5	d	r	CAT4	f	6
Узбекский плов	\nИнгредиенты:\n• Баранина – 1 кг.\n• Курдюк – 200 гр.\n• Морковка (жёлтая или оранжевая) – 1 кг.\n• Рис – 1 кг.\n• Лук – 500 гр.\n• Масло (хлопковое или подсолнечное).\n• Чесночок – 2 головки.\n• Нут (заранее замоченный) – 250 гр.\n• Кишмиш – 150 гр.\n• Перчик острый (стручком) – 2 шт.\n• Специи – зира, куркума, барбарис, шафран, перец красный (сладкий).\nСпособ приготовления:\nРис необходимо промыть 6-7 раз и залив водой отставить в сторону. Мясо нарезать крупными кусками. Если есть кости, то нужно разрубить их (но не мельчить). Морковку очистить и нарезать соломкой средней величины. Лук нужно нашинковать кольцами или полукольцами.\nЗатем необходимо разогреть казан и влить в него масло. Далее, сделать сильный огонь и дождаться момента, когда пойдёт из казана дымок – это будет означать, что масло прокалилось. Дальше в масло нужно бросить немного лука, для того чтобы он впитал в себя все вредные вещества масла. Когда лук потемнеет вынуть его и выбросить.\nДальше необходимо пожарить курдюк, порезанный на кубики до румяной корочки. Потом вынуть приготовленный таким образом курдюк, обсыпать его луком, поперчить, посолить, и скушать с лепёшкой или хлебом.\nПосле необходимо в казан забросить мясо с костями и жарить его на таком же сильном огне до образования румяной корочки. Если мяса много, то его нужно обжаривать порционо. Покрылось мясо с костями румяной корочкой, вынуть его из казана и забросить следующую порцию. После того, как всё мясо пережарилось его необходимо выложить обратно в казан и прибавить к нему лук.\nПосле того как лук слегка подрумянится, в казан нужно добавить морковку подождать несколько минут и все компоненты перемешать.\nПри обжаривании мяса с овощами нужно не забывать и их периодически помешивать шумовкой. Когда из моркови уйдёт лишняя влага, кости с мясом надо постараться переложить на дно казана.\nДальше обжаренные компоненты необходимо залить водой (на 1 кг риса – литр, 1,200 воды, в зависимости от сорта риса). Положить специи, перчик стручком, чеснок и варить зирвак в течение 30-40 минут на среднем огне.\nЧерез 15 минут после начала варки зирвак нужно посолить таким образом, чтобы он, казался солонее обычного. Так как в дальнейшем рис вберёт в себя соль и нормализует солевой баланс плова. Также нужно уложить в плов нут, который за 20-25 минут дойдёт до готовности.\nТеперь нужно перейти к забрасыванию риса. Рис закладывается в казан небольшими порциями и разравнивается по поверхности. Вода должна слегка прикрывать рис (где-то на палец). Лучше недолить в рис воды, чем потом кушать разваренную кашу.\nВажно! Слои мяса, лука и моркови не мешаются. Каждый компонент должен готовиться отдельно.\nТеперь на большом огне вода должна полностью выпариться\nПосле того как вода испарилась, рис при помощи шумовки нужно собрать горкой (аккуратно просовывая шумовку между стенкой казана и риса до самого дна, не разрушая слоёв).\nДалее, поверх риса раскладывается ктшмиш, чеснок, и проделываются палочкой дырочки в плове до самого дна (если рис сухой, из-за нехватки воды в эти отверстия можно прибавить воды).\nТеперь плов нужно плотно закрыть крышкой и до минимума убавить огонь. Готовить, таким образом, плов ещё полчаса.\nКогда плов готов, его нужно выложить в ляган, блюдо на середину положить чеснок и всю поверхность обсыпать мясом.\n	6	d	e	CAT3	f	4
Классический наполеон	\nДля теста:\n•\tМаргарин для выпечки или масло – 400 г;\n•\tЯйцо – 1 шт.;\n•\tМука – 700 г;\n•\tЛедяная вода – 150 мл;\n•\tСоль – 1 щепотка.\nДля заварного крема:\n•\tМолоко – 1 л;\n•\tСахар – 1,5 стакана;\n•\tЯйцо – 2 шт.;\n•\tМука – 3 ст. л.;\n•\tСливочное масло – 200 г;\n•\tВанильный сахар – 5 г.\nНачнем с приготовления теста. В чашу измельчителя всыпьте просеянную несколько раз муку, соль и выложите кубиками нарезанный маргарин. Включите измельчитель на 1-2 минуты, чтобы получилась мелкая крошка. Выложите ее в глубокую миску.\nЯйцо смешайте с ледяной водой и вылейте в углубление, сделанное по центру в миске с крошкой. Замесите тесто и разделите на 12 равных частей.\n\nКаждый кусочек теста раскатайте в тонкий корж, не больше 1 мм. Выложите тесто на пергамент, обрежьте края, но не убирайте, а запеките вместе. Наколите корж вилкой и отправьте в разогретую до 200-220 градусов духовку на 3-5 минут.\nГотовые коржи остудите, обрезки отправьте в чашу измельчителя – это будет наша крошка для украшения.\nС помощью миксера взбейте муку, сахар и яйца. Продолжая взбивать, тонкой струйкой влейте молоко. Масса должна быть пышной и однородной.\nПоставьте будущий крем на плиту и доведите до кипения, постоянно помешивая. Снимите крем с огня, как только он загустеет.\nДобавьте в крем масло комнатной температуры и взбейте миксером до однородности. Готовый крем остудите.\n\nСобираем торт. Стакан крема сразу отложите, он понадобится для смазывания верха и краев торта. Первый корж смажьте 2-3 ст. ложками крема, таким образом соберите весь торт. Смажьте отложенным кремом всю поверхность и бока десерта. Уберите в холодильник на 10 часов.\nГотовый торт украсьте крошкой, а также шоколадом, ягодами, фруктами. Готово! Приятного чаепития!\n	10	s	r	CAT5	f	10
Рататуй в духовке	\nНарезанные кружочками помидоры, кабачки и баклажаны выкладываются на соус из помидоров и запечённого перца. Оригинальная подача, невероятный аромат и потрясающий вкус гарантированы.\nИнгредиенты\n•\t2 красных болгарских перца;\n•\tоливковое масло;\n•\t1 луковица;\n•\t4 зубчика чеснока;\n•\t8 помидоров;\n•\t4 веточки тимьяна;\n•\tсоль — по вкусу;\n•\t3 кабачка;\n•\t1 баклажан.\nПриготовление\nРазрежьте перцы пополам и удалите семена. Выложите овощи срезом вниз на противень, смазанный маслом или застеленный фольгой. Запекайте перцы в разогретой до 230 °C духовке 15–20 минут. Затем остудите, очистите от шкурки и нарежьте мелкими кубиками.\nНа сковороду с разогретым маслом выложите измельчённые лук и 3 зубчика чеснока и обжаривайте, помешивая, до мягкости. Очистите 4 помидора от шкурки, нарежьте маленькими кубиками и добавьте к овощам вместе с 3 веточками тимьяна.\nТушите на медленном огне, пока почти вся жидкость не испарится. Добавьте нарезанный перец и соль, готовьте ещё несколько минут и выньте тимьян.\nРаспределите томатный соус по дну формы для запекания. Лучше всего подойдёт форма диаметром 20 см. Нарежьте кабачки, баклажан и оставшиеся помидоры тонкими кружочками и выложите их на соус по кругу или полосками.\nСмешайте 1 столовую ложку оливкового масла с измельчённым зубчиком чеснока, солью и листьями с веточки тимьяна. Смажьте этой смесью овощи.Накройте форму фольгой и запекайте овощи при температуре 140 °C в течение 2 часов. Овощи должны легко протыкаться ножом или вилкой. Снимите фольгу и запекайте ещё полчаса. Если овощи вдруг начнут подгорать, снова прикройте их фольгой.\n	7	s	f	CAT3	f	5
Бархатные блинчики	\nИнгредиенты:\n3 куриных яйца;\n1/2 чайной ложки соли;\nбольшая ложка сахара;\n2,5 стакана молока;\nдва стакана муки;\n4 столовые ложки растительного масла.\nВозьмите глубокую посуду и смешайте в ней яйца, соль и сахар. Воспользуйтесь для достижения нормально однородной массы венчиком. Теперь в смесь выливают стакан молока и все тщательно перемешивают, чтобы сыпучие компоненты растворились. Постепенно вылейте оставшееся молоко в емкость. В полученную смесь необходимо добавить муку. Всыпайте ее мелкими порциями, хорошо при этом размешивая состав. В результате должна получиться однородная масса. В нее на завершающем этапе добавляют растительное масло. Масло необходимо в составе, чтобы блины не прилипали в сковороде. После приготовления блинного теста можно приниматься за выпекание.\n\n	8	b	r	CAT5	f	8
Традиционный борщ	\nнгредиенты\n\nДля бульона:\n•\t 1½–2 л воды;\n•\t400–500 г свинины или говядины на кости.\nДля зажарки:\n•\t2 небольшие свёклы;\n•\t1 средняя морковь;\n•\t3 средние луковицы;\n•\t4–5 столовых ложек растительного масла;\n•\tщепотка лимонной кислоты, немного столового уксуса или ½ лимона;\n•\t2 столовые ложки томатной пасты.\nДля борща:\n•\t300 г свежей белокочанной капусты;\n•\t4 средние картофелины;\n•\tсоль — по вкусу;\n•\t1–2 сушёных лавровых листа;\n•\tзелень — по вкусу;\n•\t1 зубчик чеснока — опционально;\n•\tщепотка молотой гвоздики — опционально;\n•\tщепотка молотого чёрного перца — опционально.\nПриготовление\nШаг 1. Сварите бульон\nНалейте в кастрюлю холодную воду, выложите мясо и поставьте на средний огонь. Бульон будет вкуснее, если использовать именно мясо на кости.\n\nСледите за бульоном, перед закипанием снимите пену.\n\nКогда жидкость закипит, накройте кастрюлю крышкой и варите на медленном огне час-полтора.\nШаг 2. Сделайте зажарку\nВымойте и почистите свёклу, морковь и лук. Свёклу натрите на крупной тёрке, а морковь — на средней. Лук нарежьте небольшими кубиками.\nНалейте масло в сковороду, включите средний огонь. Обжаривайте лук и морковь, помешивая, около 5 минут.\n\nЗатем выложите свёклу. Добавьте к ней лимонную кислоту, уксус или сок лимона. Благодаря этому борщ будет по-настоящему красным и приобретёт приятную кислинку.\n\nГотовьте зажарку ещё 5 минут. После этого добавьте томатную пасту, перемешайте и оставьте на огне ещё на 5–7 минут.\n\nШаг 3. Соберите борщ\nКогда бульон сварится, выньте из него мясо. Пока оно остывает, засыпьте в кастрюлю нашинкованную капусту. Через 5–10 минут добавьте нарезанный соломкой или кубиками картофель.\nПорядок закладки овощей можно менять. Если капуста молодая, её лучше добавить уже после картошки. Ну или одновременно, если ваш сорт картофеля разваривается быстро.\n\nПока варится картофель, отделите мясо от кости и нарежьте кубиками. Верните его в суп. Посолите по вкусу.\n\nДобавьте зажарку и перемешайте.\n\nЗакиньте лавровый лист и мелко порубленную зелень. Накройте кастрюлю крышкой и варите ещё 5–7 минут.\n\nДля аромата можно добавить в кастрюлю немного измельчённого чеснока, молотой гвоздики или чёрного перца. Оставьте борщ под крышкой настаиваться 5–10 минут.\n\n	9	d	r	CAT2	f	9
Люля-кебаб	\nИнгредиенты:\n•\tмякоть баранины (задняя часть) — 1 кг\n•\tкурдючный жир — 200 г\n•\tрепчатый лук — 150 г\n•\tмолотый кориандр — 1 ч. л.\n•\tзира — 0,5 ч. л.\n•\tсладкая паприка — 0,5 ч. л.\n•\tострый красный перец — щепотка\n•\tсоль и черный перец — по вкусу\n•\tсвежая кинза и зеленый лук — для подачи\nПриступаем к процессу: \n1.\tОчищаем баранину от пленок и прожилок, рубим поперек волокон на пласты толщиной 1,5 см, а затем — мелким кубиком.\n2.\tКурдючный жир сначала нарезаем соломкой, а потом — мелкими кусочками размером с рисовое зернышко.\n3.\tОчищаем луковицы от шелухи и режем мелким кубиком.\n4.\tСоединяем мясо, сало и лук, хорошо вымешиваем, слегка отбиваем о деревянную доску.\n5.\tПриправляем полученную массу солью и специями.\n6.\tЗатягиваем миску с фаршем пищевой пленкой и ставим в холодильник на 2 часа.\n7.\tФормируем из фарша плотные не слишком толстые колбаски, насаживаем на шпажки.\n8.\tОбжариваем колбаски над раскаленными углями, время от времени переворачивая.\n9.\tПодаем люля-кебаб горячими, со свежей зеленью, зеленым луком и соусом наршараб.\n	11	d	e	CAT3	f	11
Ризотто с грибами	\nИнгредиенты:\n•\t300 г грибов (шампиньонов или белых);\n•\t1 столовая ложка оливкового масла;\n•\t2 столовые ложки сливочного масла;\n•\t1 луковица;\n•\t200 г риса;\n•\t50 мл белого сухого вина;\n•\t1 л куриного, грибного или овощного бульона;\n•\t1 зубчик чеснока;\n•\tнесколько веточек петрушки;\n•\t50 г пармезана;\n•\tсоль — опционально.\nПриготовление\nНарежьте грибы тонкими пластинками и выложите на сковороду с разогретым оливковым маслом. Обжаривайте, пока грибы не подрумянятся.\nВ сотейнике растопите сливочное масло. Выложите мелко нарезанный лук и обжарьте его до мягкости. Добавьте рис и готовьте, помешивая, пару минут.\nВлейте в сотейник вино. Когда оно впитается в рис, постепенно влейте горячий бульон. Затем добавьте измельчённый чеснок, обжаренные грибы, рубленую петрушку, тёртый пармезан и соль и хорошо перемешайте.\n	12	d	i	CAT3	f	12
